                        <h2>Camp History</h2>
                    <p>
                    The camp was established in 1938 as <strong>Lager IX Versen</strong>,
                    one of the <em><a href=""https://en.wikipedia.org/wiki/Emslandlager""> Emslandlager</a></em>
                    group of labour camps. It was designed to hold up 
                    to 1,500 political prisoners, who worked under the direction of the <em>
                    <a href =""https://en.wikipedia.org/wiki/Reichsarbeitsdienst"">Reichsarbeitsdienst</a></em> 
                    (""State Labor Service"") in the local peat bogs.[1] 
                    After the outbreak of World War II in September 1939 the camp was taken 
                    over by <a href =""https://en.wikipedia.org/wiki/Military_district_(Germany)""> Military 
                    District </a>  VI,[2] and designated Stalag VI-B, with sub-camps
               ");
                WriteLiteral(@"     (Zweiglager) — designated Stalag VI-B/Z — a few kilometres away at Oberlangen, 
                    Wesuwe and Fullen. On 13 May 1942 Stalag VI-B and its sub-camps all
                    came under the administrative control of Stalag VI-C at Bathorn, and were renamed 
                    Stalag VI-C/Z.<br>

                    The camps of Stalag VI-B were first occupied by prisoners-of-war taken 
                    during the invasion of Poland. In early 1940 these were replaced by POW from 
                    France and Belgium. In addition, there were Dutch, Polish, and later Russians
                        in the camps. After the armistice of 1943 Italian prisoners arrived.[2]<br>

                    From November 1944 prisoners from the 
                    <a href=""https://en.wikipedia.org/wiki/Neuengamme_concentration_camp"">Neuengamme</a>  concentration camp in 
                        Hamburg were housed at Versen to work on the Friesenwall, part of the Atlantic 
              ");
                WriteLiteral(@"      Wall between the Netherlands and Denmark.[4]<br>

                        The camps were abandoned in March 1945, and  the prisoners were
                        moved by train or marched east to other camps.[2]<br>


                    The camp at Versen was used after the war as a prison under the control of the
                    Lower Saxony Ministry of Justice. After a fire in 1972, much of the camp was 
                    rebuilt. It currently operates as Justizvollzugsanstalt Meppen (""Meppen 
                    Correctional Institution"").[5]
